(150, 'eel', 'a:8:{s:8:\"last_tab\";s:1:\"6\";s:9:\"site_logo\";a:9:{s:3:\"url\";s:56:\"http://www.eel-bd.com/wp-content/uploads/2018/03/EEL.jpg\";s:2:\"id\";s:2:\"32\";s:6:\"height\";s:2:\"95\";s:5:\"width\";s:3:\"167\";s:9:\"thumbnail\";s:63:\"http://www.eel-bd.com/wp-content/uploads/2018/03/EEL-150x95.jpg\";s:5:\"title\";s:3:\"EEL\";s:7:\"caption\";s:0:\"\";s:3:\"alt\";s:0:\"\";s:11:\"description\";s:0:\"\";}s:9:\"copy_text\";s:170:\"<p>© Copyright 2018 | All Rights Reserved | Developed by <strong><a href=\"http://bimee.com.bd/\" target=\"_blank\" rel=\"noopener\">Bimee</a> </strong>  </p>\r\n<p>&nbsp;</p>\";s:10:\"about_text\";s:4211:\"<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: center; line-height: normal; mso-outline-level: 1;\" align=\"center\"><b><span style=\"font-size: 30px; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; color: #333333; mso-font-kerning: 18.0pt;\">We provide best<br /> quality service from 1990</span></b></p>\r\n<p align=\"center\"> </p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 18.0pt; background: white;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; color: #333333; background: white;\">M/s EVEREST EASTERN Ltd., is one of the reputed architectural aluminium fabricators in Bangladesh. Its voyage began in 1990 as a fabricator and installer of architectural aluminium and glass products. <span style=\"letter-spacing: .25pt;\">Being the best aluminium supplier in Bangladesh, our company has a fully organized aluminium fabrication division with a wide range of products &amp; services like curtain wall series, doors, windows (unitized and stick system) etc.</span></span><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; color: #333333;\"> We manage all the aluminium and glass requirements for high rise towers, commercial buildings and as well as residential places. All our installation work is done by trained and skilled labor power. Apart from that, for every project, our designers show their expertise and take the responsibility to ensure that all the materials they specify meet both economic and technical requirements. Our commitment is to provide the highest quality in all aspects of our service.</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: 0.25pt;\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: 18.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; color: #333333; background: white;\">The company was founded in the year 1990 by Engr. Md. Shah Suja Khan, who is the managing director of the company, followed by a team of experts who are highly qualified and well experienced professionals in their fields.</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: 18.0pt;\"><b><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; color: #333333; background: white;\">VISION:</span></b></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: 18.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; color: #333333; background: white;\">Our vision is to be the brand leader operating in construction industry with a solid customer base and providing complete satisfaction to our client in every project. We believe that this can be achieved by delivering high-end quality and cost-effective products.</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: 18.0pt;\"><b><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; color: #333333; background: white;\">MISSION:</span></b></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: 18.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; color: #333333; background: white;\">A good company should serve the society besides catering to the needs of its clients. In order to attain that goal our strong corporate culture and environmental friendly measures ensure the sustainability of our company.</span></p>\";s:6:\"md_img\";a:9:{s:3:\"url\";s:99:\"http://www.eel-bd.com/wp-content/uploads/2019/05/59770905_376891573037193_5819136715587059712_n.jpg\";s:2:\"id\";s:3:\"291\";s:6:\"height\";s:3:\"412\";s:5:\"width\";s:3:\"402\";s:9:\"thumbnail\";s:107:\"http://www.eel-bd.com/wp-content/uploads/2019/05/59770905_376891573037193_5819136715587059712_n-150x150.jpg\";s:5:\"title\";s:46:\"59770905_376891573037193_5819136715587059712_n\";s:7:\"caption\";s:0:\"\";s:3:\"alt\";s:0:\"\";s:11:\"description\";s:0:\"\";}s:9:\"name_text\";s:344:\"<p><strong><em><span style=\"font-size: 12pt; line-height: 107%; font-family: \'Times New Roman\', serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Md. Shah Suja Khan</span></em></strong></p>\";s:16:\"designation_text\";s:52:\"<p><em><strong> Managing Director</strong></em></p>\";s:9:\"desc_text\";s:1023:\"<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">Engr. Md. Shah Suja Khan, the founder and Managing Director of the company, had passed B.Sc. Engineering in Civil Department, from BUET. He was in the batch of 1970 and at present, is a businessman. Prior to assuming his current position, he has worked in Bangladesh Thai Aluminium Limited as Deputy Chief Engineer from 1984 to 1990. He has monitored the work of aluminium fabrication and anodization of Bangladesh Bank Head Office, which was one of the first high rise buildings in Bangladesh and the Sena Kalyan Bhaban was constructed directly under his supervision. Furthermore, in 1990 he supervised the first Aluminum production factory, the Aluminum Excretion Press and Anodization Plant. Subsequently, in 1990 he started his own business and since then is working in this field with an experience of 34 years in aluminium industry from 1984-2018.</span></p>\";}', 'yes'),
